import React from "react";
import ReactDOM from "react-dom";
import "./index.css"; 
const heading ={
    color:'#fa9191',
    textTransform:'capitalize'
}
// const img1="https://picsum.photos/700/700";
// const img2="https://picsum.photos/500/700";
// const img3="https://picsum.photos/700/500";
// const links="https://codeforces.com/profile/chandrajeetm";
 ReactDOM.render(
    <>
<h1 style={heading}  contentEditable="true">CKM Netflix list</h1> 

<p className="heading">
    list of five Best Series
    <ol>
        <li>Dark </li>
        <li>Extra curricular</li>
        <li>the secret of my wife </li>
        <li>fuddu</li>
        <li>hello ms india </li>

    </ol>
</p>
 </>
,document.getElementById('root')
);
